<template>
    <div class="content-wrapper container justify-content-start">
        <div class="d-flex flex-column-reverse flex-md-row align-items-center justify-content-between mb-2 w-100">
            <div class="d-flex gap-2">
                <button class="btn btn-sm btn-primary" @click="$router.go(-1)">
                    <i class="bi bi-arrow-left me-2"></i>{{ $t('back') }}
                </button>
                <button v-if="target.approved" class="btn btn-sm btn-warning" @click="$router.go(-1)">
                    <i class="bi bi-x-circle me-2"></i>Refuse
                </button>
                <button v-else class="btn btn-sm btn-success" @click="$router.go(-1)">
                    <i class="bi bi-check-circle me-2"></i>Approve
                </button>
                <button class="btn btn-sm btn-danger" @click="$router.go(-1)">
                    <i class="bi bi-trash me-2"></i>Delete
                </button>
            </div>

            <div class="d-flex flex-column">
                <h1>{{ target.url }}</h1>
                <small class="text-center text-md-end">by {{ target.suggested_by.nickname | filterNickname }}</small>
            </div>

        </div>
        <div class="d-flex justify-content-end gap-2 w-100">
            <template v-if="target.categories.length > 0">
                <div v-for="category in target.categories" :key="category.id" class="badge badge-primary">{{ $t(`target.categories.${category.key}`) }}</div>
            </template>
            <template v-else>
                <div class="badge badge-gray">Other</div>
            </template>
        </div>
        <div v-if="target.status.length" class="card w-100 mt-3">
            <div class="card-body">
                <table class="table">
                    <thead>
                    <tr>
                        <th>Точка доступу</th>
                        <th>ASN</th>
                        <th>Час перевірки</th>
                        <th>Час відповіді сервера</th>
                    </tr>
                    </thead>
                    <tbody>
                    <tr v-for="(status, index) in target.status" :key="index">
                        <td>
                            <div v-if="status.is_down" class="badge badge-secondary" v-tooltip:top="status.status_code + ' - ' + status.message">Offline</div>
                            <div v-else class="badge badge-primary" v-tooltip:top="status.status_code + ' - ' + status.message">Online</div>
                            <img v-if="status.node.location" :src="'../../img/flags/' + status.node.location.iso + '.svg'" alt="" class="flag mx-3">{{ status.node.location.country }}, {{ status.node.location.city }}
                        </td>
                        <td>
                            {{ status.node.asn }}
                        </td>
                        <td>
                            {{ status.last_checked | filterDateTime }}
                        </td>
                        <td>
                            {{ status.response_time }}s
                        </td>
                    </tr>
                    </tbody>
                </table>
            </div>
        </div>
